import React from "react";
import { Card, Row, Col } from "react-bootstrap";
import "./Cards.css";

const Cards = () => {
  return (
    <div>
      <div className="cards">
      <Container>
  <Row className="justify-content-md-center">
    <Col xs lg="2">
      1 of 3
    </Col>
    <Col md="auto">Variable width content</Col>
    <Col xs lg="2">
      3 of 3
    </Col>
  </Row>
  <Row>
    <Col>1 of 3</Col>
    <Col md="auto">Variable width content</Col>
    <Col xs lg="2">
      3 of 3
    </Col>
  </Row>
</Container>
      </div>
    </div>
  );
};

export default Cards;
